import React, { Component } from 'react';
import Home from './home/Home';
import './Globals.css';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      robot: {
        name: "",
        type: ""
      },

      robotTypes: [
        {UNIPEDAL: 'Unipedal'},
        {BIPEDAL: 'Bipedal'},
        QUADRUPEDAL: 'Quadrupedal',
        ARACHNID: 'Arachnid',
        RADIAL: 'Radial',
        AERONAUTICAL: 'Aeronautical'
      ]
    }
  }

  render() {
    return (
      <div className="App">
        <Home robot={this.state.robot}/>
      </div>
    );
  }
}

export default App;
